import Graph from '../Components/Graph';


const GraphList = ({plotImage, inputData}) => {

    const data = inputData.map(depth => {
        return <Graph 
        key={depth.id}
        depth={depth}/>
    })





    return(
        <div>
        <Graph data={data}/>
        </div>
    )
}

export default GraphList;
